from typing import List, Dict
from aiohttp import web

from openapi_server.models.item_response import ItemResponse
from openapi_server import util


async def get_item_feed(request: web.Request, accept, x_ebay_c_marketplace_id, range, feed_scope, category_id, _date=None) -> web.Response:
    """get_item_feed

    &lt;p&gt;This method lets you download a TSV_GZIP (tab separated value gzip) &lt;b&gt; Item&lt;/b&gt; feed file. The feed file contains all the items from &lt;b&gt; all&lt;/b&gt; the child categories of the specified category.  The first line of the file is the header, which labels the columns and indicates the order of the values on each line.  Each header is described in the &lt;a href&#x3D;\&quot;/api-docs/buy/feed/resources/item/methods/getItemFeed#h3-response-fields\&quot;&gt;Response fields&lt;/a&gt; section.  &lt;/p&gt; &lt;p&gt; There are two types of item feed files generated: &lt;ul&gt; &lt;li&gt;A daily &lt;b&gt;Item&lt;/b&gt; feed file containing all the newly listed items for a specific category, date, and marketplace (&lt;b&gt;feed_scope&lt;/b&gt; &#x3D; &lt;code&gt;NEWLY_LISTED&lt;/code&gt;)&lt;/li&gt;  &lt;li&gt;A weekly &lt;b&gt;Item Bootstrap&lt;/b&gt; feed file containing &lt;i&gt; all&lt;/i&gt; the items in a specific category and marketplace (&lt;b&gt;feed_scope&lt;/b&gt; &#x3D; &lt;code&gt;ALL_ACTIVE&lt;/code&gt;)&lt;/li&gt;  &lt;/ul&gt;  &lt;/p&gt;   &lt;p&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;&lt;b&gt;Note: &lt;/b&gt;  Filters are applied to the feed files. For details, see &lt;a href&#x3D;\&quot;/api-docs/buy/static/api-feed_beta.html#Feed2\&quot;&gt;Feed File Filters&lt;/a&gt;. When curating the items returned, be sure to code as if these filters are not applied as they can be changed or removed in the future.&lt;/span&gt;&lt;/p&gt;&lt;h3&gt;&lt;b&gt;Downloading feed files &lt;/b&gt;&lt;/h3&gt;             &lt;p&gt;Item feed files are binary gzip files. If the file is larger than 100 MB, the download must be streamed in chunks. You specify the size of the chunks in bytes using the &lt;a href&#x3D;\&quot;#range-header\&quot;&gt;Range&lt;/a&gt; request header. The &lt;a href&#x3D;\&quot;#content-range\&quot;&gt;Content-range&lt;/a&gt; response header indicates where in the full resource this partial chunk of data belongs  and the total number of bytes in the file.       For more information about using these headers, see &lt;a href&#x3D;\&quot;/api-docs/buy/static/api-feed_beta.html#retrv-gzip\&quot;&gt;Retrieving a gzip feed file&lt;/a&gt;.    &lt;/p&gt;    &lt;p&gt;In addition to the API, there is an open source &lt;a href&#x3D;\&quot;https://github.com/eBay/FeedSDK\&quot; target&#x3D;\&quot;_blank\&quot;&gt;Feed SDK&lt;/a&gt; written in Java that downloads, combines files into a single file when needed, and unzips the entire feed file. It also lets you specify field filters to curate the items in the file.&lt;/p&gt;              &lt;p&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;  &lt;b&gt; Note:&lt;/b&gt; A successful call will always return a TSV.GZIP file; however, unsuccessful calls generate errors that are returned in JSON format. For documentation purposes, the successful call response is shown below as JSON fields so that the value returned in each column can be explained. The order of the response fields shows the order of the columns in the feed file.&lt;/span&gt;  &lt;/p&gt;                &lt;h3&gt;&lt;b&gt;Restrictions &lt;/b&gt;&lt;/h3&gt;                &lt;p&gt;For a list of supported sites and other restrictions, see &lt;a href&#x3D;\&quot;/api-docs/buy/feed/overview.html#API\&quot;&gt;API Restrictions&lt;/a&gt;.&lt;/p&gt;

    :param accept: The formats that the client accepts for the response.&lt;br&gt;&lt;br&gt;A successful call will always return a TSV.GZIP file; however, unsuccessful calls generate errors that are returned in JSON format.&lt;br&gt;&lt;br&gt;&lt;b&gt;Default:&lt;/b&gt; &lt;code&gt;application/json,text/tab-separated-values&lt;/code&gt;
    :type accept: str
    :param x_ebay_c_marketplace_id: The ID of the eBay marketplace where the item is hosted. &lt;b&gt;Note: &lt;/b&gt; This value is case sensitive.&lt;br&gt;&lt;br&gt;For example: &lt;br&gt;&amp;nbsp;&amp;nbsp;&lt;code&gt;X-EBAY-C-MARKETPLACE-ID &#x3D; EBAY_US&lt;/code&gt;  &lt;br&gt;&lt;br&gt; For a list of supported sites see, &lt;a href&#x3D;\&quot;/api-docs/buy/feed/overview.html#API\&quot;&gt;API Restrictions&lt;/a&gt;.
    :type x_ebay_c_marketplace_id: str
    :param range: &lt;a name&#x3D;\&quot;range-header\&quot;&gt;&lt;/a&gt;This header specifies the range in bytes of the chunks of the gzip file being returned. &lt;br&gt;&lt;br&gt;&lt;b&gt; Format:&lt;/b&gt; &lt;code &gt;bytes&#x3D;&lt;em&gt;startpos&lt;/em&gt;-&lt;em&gt;endpos&lt;/em&gt;&lt;/code&gt;&lt;br&gt;&lt;br&gt;  For example, the following retrieves the first 10 MBs of the feed file. &lt;br&gt;&lt;br&gt;&amp;nbsp;&amp;nbsp;&lt;code&gt;Range bytes&#x3D;0-10485760&lt;/code&gt; &lt;br&gt;&lt;br&gt;For more information about using this header, see &lt;a href&#x3D;\&quot;/api-docs/buy/static/api-feed_beta.html#retrv-gzip\&quot;&gt;Retrieving a gzip feed file&lt;/a&gt;. &lt;br&gt;&lt;br&gt;&lt;b&gt;Maximum:&lt;/b&gt; 100 MB (10MB in the Sandbox)
    :type range: str
    :param feed_scope: Specifies the type of feed file to return. &lt;br&gt;&lt;br&gt;&lt;b&gt;Valid Values: &lt;/b&gt;   &lt;ul&gt; &lt;li&gt;&lt;b&gt; NEWLY_LISTED&lt;/b&gt; - Returns the daily &lt;b&gt;Item&lt;/b&gt; feed file containing all Good &#39;Til Cancelled items that were listed on the day specified by the &lt;b&gt; date&lt;/b&gt; parameter in the category specified by the &lt;b&gt; category_id&lt;/b&gt; parameter.&lt;br&gt;&lt;br&gt;&lt;code&gt;/item?feed_scope&#x3D;NEWLY_LISTED&amp;category_id&#x3D;15032&amp;date&#x3D;20170925&lt;/code&gt;&lt;/li&gt;&lt;li&gt;&lt;b&gt;ALL_ACTIVE&lt;/b&gt; - Returns the weekly &lt;b&gt;Item Bootstrap&lt;/b&gt; feed file containing all the Good &#39;Til Cancelled items in the category specified by the &lt;b&gt;category_id&lt;/b&gt; parameter.&lt;br&gt;&lt;br&gt;&lt;span class&#x3D;\&quot;tablenote\&quot;&gt;&lt;b&gt;Note:&lt;/b&gt; Bootstrap files are generated every Tuesday and the file is available on Wednesday. However, the exact time the file is available can vary so we recommend you download the Bootstrap file on Thursday. The items in the file are the items that were in the specified category on Sunday.&lt;/span&gt; &lt;br&gt;&lt;br&gt;&lt;code&gt;/item?feed_scope&#x3D;ALL_ACTIVE&amp;category_id&#x3D;15032&lt;/code&gt;  &lt;/ul&gt;
    :type feed_scope: str
    :param category_id: An eBay top-level category ID of the items to be returned in the feed file. &lt;br&gt; &lt;br&gt;The list of eBay category IDs changes over time and category IDs are not the same across all the eBay marketplaces. To get a list of the top-level categories for a marketplace, you can use the Taxonomy API &lt;a href&#x3D;\&quot;/api-docs/commerce/taxonomy/resources/category_tree/methods/getCategoryTree\&quot;&gt;getCategoryTree&lt;/a&gt; method. This method retrieves the complete category tree for the marketplace. The top-level categories are identified by the &lt;b&gt;categoryTreeNodeLevel&lt;/b&gt; field. &lt;br&gt;&lt;br&gt;&lt;b&gt;For example:&lt;/b&gt;&lt;br&gt;&amp;nbsp;&amp;nbsp;&lt;code&gt;\&quot;categoryTreeNodeLevel\&quot;: 1&lt;/code&gt; &lt;br&gt;&lt;br&gt;For details see &lt;a href&#x3D;\&quot;/api-docs/buy/buy-categories.html\&quot;&gt;Get Categories for Buy APIs&lt;/a&gt;. &lt;/li&gt;  &lt;/ul&gt; &lt;br&gt;&lt;br&gt;   &lt;b&gt;Restriction:&lt;/b&gt; Must be a top-level (L1) category other than Real Estate. Items listed under Real Estate L1 categories are excluded from all feeds in all marketplaces.
    :type category_id: str
    :param _date: The date of the daily &lt;b&gt;Item&lt;/b&gt; feed file (&lt;b&gt;feed_scope&lt;/b&gt;&#x3D;&lt;code&gt;NEWLY_LISTED&lt;/code&gt;) you want. &lt;p&gt;The &lt;b&gt; date&lt;/b&gt; is required only for the daily &lt;b&gt;Item&lt;/b&gt; feed file. If you specify a date for the &lt;b&gt;Item Bootstrap&lt;/b&gt; file (&lt;b&gt;feed_scope&lt;/b&gt;&#x3D;&lt;code&gt;ALL_ACTIVE&lt;/code&gt;), the date is ignored and the latest file is returned. The date the &lt;b&gt;Item Bootstrap&lt;/b&gt; feed file was generated is returned in the &lt;b&gt;Last-Modified&lt;/b&gt; response header.&lt;/code&gt;&lt;/p&gt;    &lt;p&gt;The &lt;b&gt; Item&lt;/b&gt; feed files are generated every day and there are 14 daily files available.&lt;/p&gt;  &lt;span class&#x3D;\&quot;tablenote\&quot;&gt; &lt;b&gt;Note: &lt;/b&gt;&lt;ul&gt;  &lt;li&gt;The daily &lt;b&gt;Item&lt;/b&gt; feed files are available each day after 9AM MST (US Mountain Standard Time), which is -7 hours UTC time.&lt;/li&gt;    &lt;li&gt;There is a 48 hour latency when generating the &lt;b&gt; Item&lt;/b&gt; feed files. This means you can download the file for July 10th on July 12 after 9AM MST. &lt;br&gt;&lt;br&gt;&lt;b&gt;Note: &lt;/b&gt; For categories with a large number of items, the latency can be up to 72 hours.&lt;/li&gt; &lt;/ul&gt;&lt;/span&gt; &lt;p&gt;&lt;b&gt; Format: &lt;/b&gt;&lt;code&gt;yyyyMMdd&lt;/code&gt;&lt;br&gt;&lt;br&gt;&lt;b&gt; Requirements: &lt;/b&gt; &lt;ul&gt;  &lt;li&gt;Required when &lt;b&gt;feed_scope&lt;/b&gt;&#x3D;&lt;code&gt;NEWLY_LISTED&lt;/code&gt; &lt;/li&gt;  &lt;li&gt;Must be within 3-14 days in the past&lt;/li&gt;&lt;/ul&gt;
    :type _date: str

    """
    return web.Response(status=200)
